import React, { useState, useEffect } from "react";
import axios from "axios";

const DEFAULT_IMAGE = "https://source.unsplash.com/400x300/?city,landmark";

function App() {
  const [location, setLocation] = useState("");
  const [places, setPlaces] = useState({});
  const [loading, setLoading] = useState(false);
  const [selectedPlace, setSelectedPlace] = useState(null);

  const fetchPlaces = async (loc) => {
    if (!loc) return alert("Please enter a location");
    setLoading(true);
    try {
      const response = await axios.get(
        `http://localhost:5000/api/places?location=${loc}`
      );
      setPlaces(response.data);
    } catch (err) {
      console.error("Fetch error:", err);
      alert("Failed to fetch places.");
    }
    setLoading(false);
  };

  // Auto-detect user location
  useEffect(() => {
    navigator.geolocation.getCurrentPosition(
      async (position) => {
        const { latitude, longitude } = position.coords;
        try {
          const response = await axios.get(
            `https://maps.googleapis.com/maps/api/geocode/json?latlng=${latitude},${longitude}&key=AIzaSyDki4k3wRgR7TEw1ugkkaWqe1tBxxnDfDk`
          );
          const userLocation =
            response.data.results[0]?.address_components.find((comp) =>
              comp.types.includes("locality")
            )?.long_name || "Hyderabad"; // fallback city
          setLocation(userLocation);
          fetchPlaces(userLocation);
        } catch (err) {
          console.error("Location fetch error:", err);
        }
      },
      (error) => {
        console.error("Geolocation error:", error);
      }
    );
  }, []);

  const fetchPlaceDetails = async (placeId) => {
    try {
      const response = await axios.get(
        `http://localhost:5000/api/place-details?place_id=${placeId}`
      );
      setSelectedPlace(response.data);
    } catch (err) {
      console.error("Details error:", err);
      alert("Failed to fetch place details.");
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 p-4">
      <h1 className="text-4xl font-bold text-center mb-6 text-indigo-700">
        üó∫Ô∏è Local Explorer
      </h1>

      <div className="flex justify-center mb-6">
        <input
          type="text"
          placeholder="Enter location (e.g., Gachibowli)"
          value={location}
          onChange={(e) => setLocation(e.target.value)}
          className="border border-gray-300 rounded-l px-4 py-2 w-1/3"
        />
        <button
          onClick={() => fetchPlaces(location)}
          className="bg-indigo-500 text-white px-4 py-2 rounded-r hover:bg-indigo-600"
        >
          Search
        </button>
      </div>

      {loading && <p className="text-center text-lg">Loading places...</p>}

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {Object.entries(places).map(([category, placesArray]) => (
          <div key={category}>
            <h2 className="text-2xl font-semibold mb-4 capitalize text-indigo-600">
              {category}
            </h2>
            {placesArray.length === 0 ? (
              <p className="text-gray-500">No {category} found in this area.</p>
            ) : (
              placesArray.map((place, index) => (
                <div
                  key={index}
                  className="bg-white rounded-xl shadow hover:shadow-lg transition p-4 mb-4 cursor-pointer"
                  onClick={() => fetchPlaceDetails(place.place_id)}
                >
                  <img
                    src={place.photo_url || DEFAULT_IMAGE}
                    alt={place.name}
                    className="w-full h-52 object-cover rounded mb-3"
                  />
                  <h3 className="text-lg font-bold">{place.name}</h3>
                  <p className="text-gray-600">{place.formatted_address}</p>
                  {place.rating && (
                    <p className="text-yellow-500">‚≠ê {place.rating}</p>
                  )}
                </div>
              ))
            )}
          </div>
        ))}
      </div>

      {/* Modal */}
      {selectedPlace && (
        <div
          className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center"
          onClick={() => setSelectedPlace(null)}
        >
          <div
            className="bg-white rounded-xl shadow p-6 w-11/12 md:w-2/3 lg:w-1/2"
            onClick={(e) => e.stopPropagation()}
          >
            <h2 className="text-2xl font-bold mb-2">{selectedPlace.name}</h2>
            <p className="mb-2">{selectedPlace.formatted_address}</p>
            {selectedPlace.rating && (
              <p className="text-yellow-500 mb-2">‚≠ê {selectedPlace.rating}</p>
            )}
            <button
              className="mt-4 bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
              onClick={() => setSelectedPlace(null)}
            >
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
